import React from 'react';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import Card from '../components/Card';
import { useState, useEffect } from "react"

export default function Home() {
  const [search,setSearch]=useState('');
  const [foodCat, setFoodCat] = useState([]);
  const [foodItem, setFoodItem] = useState([]);
  const loadData = async () => {
    const result = await fetch("http://localhost:5000/api/foodData", {
      method: "POST",
      headers: {
        'Content-Type': "application/json"
      }
    })
    const data = await result.json();
    setFoodCat(data[1]);
    setFoodItem(data[0]);
  }
  useEffect(() => {
    loadData();
  }, []);
  return (
    <>
      <Navbar />
      <div id="carouselExampleCaptions" className="carousel slide" data-bs-ride="carousel" >
      <div className="carousel-indicators">
        <button type="button" data-bs-target="#carouselExampleCaptions" data-bs-slide-to="0" className="active" aria-current="true" aria-label="Slide 1"></button>
        <button type="button" data-bs-target="#carouselExampleCaptions" data-bs-slide-to="1" aria-label="Slide 2"></button>
        <button type="button" data-bs-target="#carouselExampleCaptions" data-bs-slide-to="2" aria-label="Slide 3"></button>
      </div>
      <div className="carousel-inner" style={{maxHeight: '500px' ,objectFit: "contain !important"}}>
        <div className="carousel-item active">
          <img src="data:image/jpeg;base64," className="d-block w-100" alt="burger" style={{height:"500px"}}/>
          
        </div>
        <div className="carousel-item">
          <img src="data:image/jpeg;base64," className="d-block w-100" alt="..." style={{height:"500px"}}/>

        </div>
        <div className="carousel-item">
          <img src="data:image/jpeg;base64," className="d-block w-100" alt="..." style={{height:"500px"}} />
        </div>
      </div>
      <div className="carousel-caption d-none d-md-block">
            <div className="d-flex justify-content-center" style={{ zIndex: 10 }}>
              <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search" value={search} onChange={(e)=>setSearch(e.target.value)} />
            </div>
          </div>
      <button className="carousel-control-prev" type="button" data-bs-target="#carouselExampleCaptions" data-bs-slide="prev">
        <span className="carousel-control-prev-icon" aria-hidden="true"></span>
        <span className="visually-hidden">Previous</span>
      </button>
      <button className="carousel-control-next" type="button" data-bs-target="#carouselExampleCaptions" data-bs-slide="next">
        <span className="carousel-control-next-icon" aria-hidden="true"></span>
        <span className="visually-hidden">Next</span>
      </button>
    </div>
      {
        foodCat.length !== 0 ?
          foodCat.map((data) => {

            return (
              <>
                <div className="fs-4" key={data._id}>{data.CategoryName}</div>
                <div className='m-3 d-flex flex-direction-row flex-wrap justify-content-start gap-5' >
                  {foodItem.filter((item) => {
                    return item.CategoryName === data.CategoryName && item.name.toLowerCase().includes(search.toLocaleLowerCase())
                  }).map((newEle) => {
                    return (
                      <Card key={newEle._id} foodItems={newEle}  options={newEle.options[0]} />
                    )
                  })}
                </div>
                <hr></hr>
              </>
            )
          }) : <div>null</div>
      }

      <Footer />
    </>
  );
}